import React from 'react';
import { useNavigate } from 'react-router-dom'; // Import useNavigate from react-router-dom
import Form from './form.jpg'; // Adjust path if necessary
import './FormPage.css';
function FormPage() {
  const navigate = useNavigate(); // Initialize useNavigate

  const handleBackClick = () => {
    navigate('/'); // Navigate to the home page
  };

  return (
    <div>
      <h1>Student Admission Form</h1>
      <img
        src={Form}
        alt="Student Admission Form"
        style={{ width: '50%', textAlign:'center',height: '50%' }} // Adjust size as needed
      />
      <br />
      <div class ='back-to-home-button '>
      <button onClick={handleBackClick}>Back to Home</button> {/* Button to navigate back */}</div>
    </div>
  );
}

export default FormPage;
